function countPairs(coordinates: number[][], k: number): number {
    let count = 0;
    for (let i = 0; i < coordinates.length; i++) {
        for (let j = i + 1; j < coordinates.length; j++) {
            const dist = (coordinates[i][0] ^ coordinates[j][0]) + (coordinates[i][1] ^ coordinates[j][1]);
            if (dist === k) {
                count++;
            }
        }
    }
    return count;
};
